import React from "react";
import { Link, NavLink } from "react-router-dom";

export default function NavBar() {
  return (
    <div>
      <Link to="/" exact>
        Home
      </Link>
      {" - "}
      <Link to="/product">About</Link>
      {" - "}
      <Link to="/contact">Contact</Link>
    </div>
  );
}
